import React, { useState } from "react";
import Modal from "react-bootstrap/Modal";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import Container from "react-bootstrap/Container";
import "bootstrap/dist/css/bootstrap.min.css";
import Img1 from "../Images/logo.png";


function Signup() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  const handleSubmit = async (event) => {
    event.preventDefault();
  
    // Get form data
    const { fullName, studentId, email, contactNumber, combination, password } = event.target.elements;
  
    // Connect to database
    const collection = await connectToDatabase();
  
    // Insert user data
    try {
      const result = await collection.insertOne({
        fullName,
        studentId,
        email,
        contactNumber,
        combination,
        password,
      });
      console.log('User added successfully:', result.insertedId);
  
      // Clear form fields or display a success message
    } catch (error) {
      console.error('Error adding user:', error);
      // Handle error, e.g., display an error message
    } finally {
      client.close();
    }
  };
  

  return (
    <div>
      <Button variant="primary" onClick={handleShow} style={{ fontFamily: "times new roman",  color: "black",     textAlign: "center"}}>
        Sign Up
      </Button>

      <Modal show={show} onHide={handleClose} centered>
        <Modal.Header >
          <div style={{ display: 'flex', justifyContent: 'center' }}>

          <img  src={Img1} alt="LOgo" 
             style={{ width: '60px', height: '60px' }}
          />

          <Modal.Title style={{ fontSize: '24px', color: '#333', margin: '0 80px', fontFamily:"times new roman" }}> STUDENT SIGNUP</Modal.Title>
          </div>
        </Modal.Header>
        <Modal.Body>
          <Container>
            <Form onSubmit={handleSubmit}>
              <Form.Group className="mb-3" controlId="formBasicUserName">
                <Form.Label>Full Name</Form.Label>
                <Form.Control type="text" placeholder="Enter Name" />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicUserName">
                <Form.Label>Student ID</Form.Label>
                <Form.Control type="text" placeholder="Enter SID" />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicUserName">
                <Form.Label>Email</Form.Label>
                <Form.Control type="email" placeholder="Enter Email" />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicUserName">
                <Form.Label>Contact Number</Form.Label>
                <Form.Control
                  type="number"
                  placeholder="Enter Contact Number"
                />
              </Form.Group>

              <Form.Label>Select Your Combination</Form.Label>
              <Form.Select aria-label="Default select example">
                <option>Select your Combination</option>
                <option value="1">Bachelor of Science Study Programme</option>
                <option value="2">
                  Bachelor of Science Honours Study Programme
                </option>
                <option value="3">
                  Bachelor of Science Honours in Statistics and Operations
                  Research (SOR) Study Programme
                </option>
                <option value="4">
                  Bachelor of Science Honours in Computation and Management (CM)
                  Study Programme
                </option>
              </Form.Select>
              <br/>
              <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
              </Form.Group>

              <Form.Group className="mb-3" controlId="formBasicCheckbox">
                <Form.Check type="checkbox" label="This is correct details" />
              </Form.Group>
            </Form>
          </Container>
        </Modal.Body>
        <Modal.Footer>
          
          <Button variant="primary" onClick={handleClose} style={{  color: '#333', margin: '0 190px', fontFamily:"times new roman" }}>
            Sign Up
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Signup;
